import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

import { LikedUsersComponent } from './components/liked-users/liked-users.component';

@NgModule({
  declarations: [
    LikedUsersComponent
  ],
  imports: [
    CommonModule
  ],
  exports: [
    LikedUsersComponent
  ]
})
export class SharedModule { }
